import { Component } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent {

}
<div>
    <img class="logotipoPagina" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSiQXRffkrpxBy9Q3kWKpOwLOSrBDRk1WGeyA&usqp=CAU" alt="">
</div>

<nav>
    <ul>
        <li class="menu"><a routerLink="/"> <img class="iconoMenu" src="../../../assets/iconosNav/iconoMenu.png " alt="iconoMenu"> Home | </a></li> 
        <li><a routerLink="/albums"><img class="iconoCd" src="data:image/png;base64," alt=""> Albums | </a></li>
        <li><a routerLink="/formularios">Formularios</a></li>
    </ul>
</nav>
